import React from 'react';
import '../App.css';
import SelectQuantity from './SelectQuantity';

function OrderRow({ item }) {
    return (
        <tr>
            <td className='App-row'>{item.name}</td>
            <td className='App-row'>{item.price}</td>
            <td className='App-row'><SelectQuantity/></td>
        </tr>      
    );
}

export default OrderRow;
